import React from 'react';
import './App.css';
import { BrowserRouter, Route } from 'react-router-dom';
// import Welcome from './Welcome';

const Welcome = () => {
  return <div>Welcome</div>
};


function App() {
  return (
    <BrowserRouter>
      <Route path="/" component={Welcome} exact={true}/>
    </BrowserRouter>
  );
}

export default App;
